define({"topics" : [{"title":"Change System Prompt","shortdesc":"\n                  <p class=\"shortdesc\">Yeastar have stored all the supported system prompts online. You can check the         supported system prompts on the PBX\n                     web page, and download an online system prompt file,         then change to the desired system prompt.\n                  </p>\n               ","id":"task_vfy_gsc_5cb","href":"topic\/change_system_prompt.html","menu": {"hasChildren":false,},"tocID":"task_vfy_gsc_5cb-d46e14895","topics":[]},{"title":"Customize System Prompt","shortdesc":"\n                  <p class=\"shortdesc\">Contact Yeastar to customize your system prompt, the upload your system prompt to the         PBX.</p>\n               ","id":"task_jtv_24c_5cb","href":"topic\/customize_system_prompt.html","menu": {"hasChildren":false,},"tocID":"task_jtv_24c_5cb-d46e14968","topics":[]},{"title":"Change an Extension&apos;s System Prompt","shortdesc":"\n                  <p class=\"shortdesc\">If a user works in a foreign language, you can set a different system prompt for the         extension user.</p>\n               ","id":"task_lmn_fvc_5cb","href":"topic\/change_an_extension_system_prompt.html","menu": {"hasChildren":false,},"tocID":"task_lmn_fvc_5cb-d46e15041","topics":[]}]});